import { redirectToCheckout, loadAirwallex } from 'airwallex-payment-elements';


const intent_id = 'int_4qdDrtFpz1D1SfuXozm4YScUOTW';
const client_secret =
  'eyJhbGciOiJIUzI1NiJ9.eyJpYXQiOjE2MDkzODE3NzIsImV4cCI6MTYwOTM4NTM3MiwiYWNjb3VudF9pZCI6IjZkMzljOGU3LWQyY2EtNGQ0Yy04N2I5LWIzY2Y3MzNkNTU2ZSIsImRhdGFfY2VudGVyX3JlZ2lvbiI6IlVLIiwiaW50ZW50X2lkIjoiaW50XzRxZERydEZwejFEMVNmdVhvem00WVNjVU9UVyJ9.ggyF_rjOVniYWGHMsPVibrsaxcXAE8BxrgsTj-MLsFM';

async function redirectHpp(){
  await loadAirwallex({
    env: 'staging'
  });
  await redirectToCheckout({
    env: 'staging',
    id: intent_id,
    client_secret: client_secret,
  })
}

function hpp() {
  return (
    <div>
      <h2>Host Payment Page (HPP) Integration</h2>
      <button onClick={redirectHpp}>Click to redirect</button>
    </div>
  )
}

export default hpp
